// import { useState } from "react";
import React from "react";
import axios from "axios";
// import { BrowserRouter as Router, Switch, Route } from "react-router-dom";

// import Test from './ApiContext';

async function getData() {
  const res = await axios.get("http://127.0.0.1:8000/sample");
  console.log(res.data[0].main_text);
  return res.data[0];
}

const res = getData();

function App() {

  const tmp = res.main_text;

  return (
  <div class="input-container">
    <h1>メインテキスト</h1>
    <p>サブテキスト</p>
    <input type="text" placeholder="メインテキストを入力してください" />
    <input type="text" placeholder={ tmp } />
    <input type="submit" value="送信"></input>
  </div>
  );

};

export default App;
